sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "topic", "subscriptionname"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "subscriptionname"]);
    var payload = {
        "topic": "projects/" + inputs.projectid + "/topics/" + inputs.topic,
        "pushConfig": {}
    };
    var pushConfig = inputs.pushConfig;
    if (pushConfig.pushEndpoint.trim()) {
        payload["pushConfig"]["pushEndpoint"] = pushConfig.pushEndpoint.trim();
        if (pushConfig.oidcToken.serviceAccountEmail.trim()) {
            payload["pushConfig"]["oidcToken"] = {
                "serviceAccountEmail": pushConfig.oidcToken.serviceAccountEmail.trim(),
                "audience": pushConfig.oidcToken.audience.trim()
            }
        }
    }
    var pushAttributes = pubSub.arrayObjecttoObject(pushConfig["attributes"]);
    if (pushAttributes)
        payload["pushConfig"]["attributes"] = pushAttributes;
    var labels = pubSub.arrayObjecttoObject(inputs.labels);
    if (labels)
        payload["labels"] = labels;
    if (inputs.expirationPolicy)
        payload["expirationPolicy"] = {
            "ttl": inputs.expirationPolicy * 24 * 3600 + "s"
        }

    if (inputs.ackDeadlineSeconds)
        payload["ackDeadlineSeconds"] = inputs.ackDeadlineSeconds;

    if (inputs.retainAckedMessages)
        payload["retainAckedMessages"] = inputs.retainAckedMessages;

    var gdt1 = new GlideDateTime("1970-01-01 00:00:00");
    var gdt2 = new GlideDateTime(inputs.messageRetentionDuration);
    var dur = new GlideDuration();
    var dur = GlideDateTime.subtract(gdt1, gdt2); //the difference between gdt1 and gdt2
    var durationSec = dur.getNumericValue() / 1000;

    if (durationSec > 10)
      payload["messageRetentionDuration"] = durationSec+"s";

    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

